@-moz-document domain("www.baidu.com") {
html {
  background-size: cover !important;
  background-attachment: fixed !important;
  background-position: center center !important;
}
body {
  background: none !important;
}
#lg > img {
  height: 0 !important;
  width: 0 !important;
  padding-left: 270px !important;
  padding-top: 129px !important;
}
#result_logo > img {
  height: 0 !important;
  width: 0 !important;
  padding-left: 101px !important;
  padding-top: 33px !important;
}


}

@-moz-document regexp("^https?://www\\.baidu\\.com/.+") {
body {
  background-color: rgba(255, 255, 255, 0.8) !important;
}
}

@-moz-document domain("www.baidu.com") {
/* customizations */

html {
  background-image: url('https://s16.postimg.org/z7i27hc39/dragons.png') !important;
}
#lg > img {
  background: url('data:image/png;base64,') 14px 31px no-repeat !important;
}
#result_logo > img {
  background: url('data:image/png;base64,') -7px -7px no-repeat !important;
}
.s_ipt_wr, .s_ipt_wr.iptfocus {
  border: 1px solid #ccc !important; 
}
.s_btn {
  background: #db9800;
  border-bottom: 1px solid #b36b2f;
}
.s_btn.btnhover, .s_btn.s_btn_h {
  background: #ff0000;
  border-bottom: 1px solid #ff0000;
}
